import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, makeStyles, Input, TextField } from '@material-ui/core';

const Header = () => {
  const { container, title, buttons } = useStyles();
  const history = useNavigate();

  return (
    <div className={container}>
      <div className={title}>Pizzaria</div>
      <div className={buttons}>
        <Button variant="contained">Entrar</Button>
        <Button variant="contained" onClick={() => { history.push('/') }}>Cadastrar</Button>
      </div>
      <Input name='Teste' />
      <TextField>Teste</TextField>
    </div>
  );
};

const useStyles = makeStyles({
  container: {
    display: 'grid',
    gridColumn: 3,
    gridTemplateColumns: '4fr 1fr',
    padding: 24,
  },
  title: {
    fontSize: 32,
    textAlign: 'left',
    marginLeft: 24,
  },
  buttons: {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-around',
  }
})

export default Header;
